import PropTypes from 'prop-types'
import { useLocation } from 'react-router-dom'


const Header = ({title}) => {
    const location = useLocation()
    return (
        <header className='header'>
          <h1>{title}</h1>
          <ul>
              <li>
                  <a href='/livres'>Livres</a>
                  <a href='/medias'>medias</a>
              </li>
          </ul>
        </header>
    )
}

Header.defaultProps = {
    title: 'Documents',
}

Header.propTypes = {
    title: PropTypes.string.isRequired,
}

